pragma solidity ^0.4.18;

import "openzeppelin-solidity/contracts/ownership/Ownable.sol";
import "openzeppelin-solidity/contracts/access/Roles.sol";

contract Trans is Ownable {

    struct D {
        uint256 h;
        uint256 uid;
        uint256 timeStamp;
        uint256 dataSize;
        uint256 supposedPrice;
        string  dataType;
    }
    struct IoT {
        address a;
        string info;
    }
    mapping(address => D[]) DB;
    mapping(address => string) IoTInfo;
    IoT[]  IoTList;

    Roles.Role IoTDevice;
    address creator;  // the boss

    constructor () public {
        creator = msg.sender;
    }

    // registerIoT
    // the creator use this
    // to add IoT device's address 
    // in the smart contract
    function registerIoT(address addr, string info)
        public
        onlyOwner
    {
        require(!Roles.has(IoTDevice, addr), "IoT Device Already Exists");

        Roles.add(IoTDevice, addr);
        IoTList.push(
            IoT(
                {
                    a:addr, info:info
                }
            )
        );
        IoTInfo[addr] = info;
    }

    // unregisterIoT
    // same as register IoT
    function unregisterIoT(address addr)
        public
        onlyOwner
    {
        require(Roles.has(IoTDevice, addr), "IoT Device Doesn't Exist");

        Roles.remove(IoTDevice, addr);
    }

    function readIoT(uint index)
        public
        view
        returns(string)
    {
        return IoTList[index].info;
    }

    // IoT device push new data
    function newData(
        uint256 h,
        uint256 uid,
        uint256 timeStamp,
        uint256 dataSize,
        uint256 supposedPrice,
        string  dataType
        )
        public
    {   
        require(Roles.has(IoTDevice, msg.sender), "IoT Device Supposed");
        DB[msg.sender].push(
            D(
                {
                    h:h,
                    uid:uid,
                    timeStamp:timeStamp,
                    dataSize:dataSize,
                    supposedPrice:supposedPrice,
                    dataType: dataType
                }
            )
        );
    }

    // search data
    function searchData(address addr)
        public
        view
        returns(uint256[],uint256[],uint256[])
    {
        uint256[] ts;
        uint256[] dsize;
        uint256[] price;
        // string[] datatype;

        for (uint i = 0; i < DB[addr].length; i++) {
            ts.push(DB[addr][i].timeStamp);
            dsize.push(DB[addr][i].dataSize);
            price.push(DB[addr][i].supposedPrice);
            // datatype.push(DB[addr][i].dataType);
        }

        return(ts, dsize, price);
    }
}
